import React, { useState } from 'react';

const Cadastro = () => {
    return (
        <div>
            <h3>Cadastro!</h3>
            <form>
                <label>
                    Nome:
                    <input type="text" value="nome"/>
                </label>
                <label>
                    Idade:
                    <input type="number" value="idade"/>
                </label>
                <button type="submit">Cadastrar</button>
            </form>
        </div>
    );
};

export default Cadastro;
